        chart.legend.align = "center"; // Выравнивание легенды по центру
        chart.legend.valign = "middle"; // Вертикальное выравнивание по центру
        chart.legend.marginLeft = 0; // Отступ от левого края
        chart.legend.itemContainers.template.paddingTop = 1; // Отступ между элементами легенды
        chart.legend.itemContainers.template.paddingBottom = 1;

        var totalValue = aggTrue + aggFalse + aggError;

        // Инициализация данных
        chart.data = [
            {
                country: "Ишда",
                litres: aggTrue,
                calculated: (aggTrue / totalValue * 100).toFixed(1) // Процент от 128
            },
            {
                country: "Захирада",
                litres: aggFalse,
                calculated: (aggFalse / totalValue * 100).toFixed(1) // Процент от 128
            },
            {
                country: "Таъмирда",
                litres: aggError,
                calculated: (aggError / totalValue * 100).toFixed(1) // Процент от 128
            }
        ];

        chart.innerRadius = 40;

        // Добавляем текст в центр диаграммы
        var label = chart.seriesContainer.createChild(am4core.Label);
        label.text = totalValue; // Текст, который вы хотите отобразить
        label.horizontalCenter = "middle";
        label.verticalCenter = "middle";
        label.fontSize = 30; // Размер текста
        label.fill = am4core.color("#fff"); // Цвет текста
        label.x = 0; // Смещаем текст по оси X
        label.y = -10; // Смещаем текст по оси Y

        var series = chart.series.push(new am4charts.PieSeries3D());
        series.dataFields.value = "litres";
        series.dataFields.category = "country";

        // Настраиваем отображение текста с использованием пересчитанного процента
        series.labels.template.text = "{calculated}%"; // Показываем пересчитанный процент
        series.slices.template.tooltipText = "{category}: {litres} агрегат ({calculated}%)"; // Добавляем подсказку

        // Отключаем текст меток
        series.labels.template.disabled = true; // Скрываем метки
        series.ticks.template.disabled = true; // Убираем соединительные линии

        // Настройка цветов сегментов
        series.colors.list = [
            am4core.color("#FF5733"),
            am4core.color("#33FF57"),
            am4core.color("yellow")
        ];

        // Изменяем текст легенды
        chart.legend.labels.template.text = "{name}: {value}"; // Формат текста
        chart.legend.labels.template.fontSize = 12; // Размер шрифта для меток
        chart.legend.valueLabels.template.fontSize = 12; // Размер шрифта для значений

        // Изменяем цвет текста в легенде на белый
        chart.legend.labels.template.fill = am4core.color("#fff"); // Белый цвет
        chart.legend.valueLabels.template.fill = am4core.color("#fff"); // Белый цвет для значений

        // // Функция для обновления данных
