        //             calculated: (this.aggFalse / totalValue * 100).toFixed(1)
        //         },
        //         {
        //             country: "Таъмирда",
        //             litres: this.aggError,
        //             calculated: (this.aggError / totalValue * 100).toFixed(1)
        //         }
        //     ];
        //     // Обновляем текст в центре диаграммы
        //     label.text = totalValue;
        // }
        //
        // // Обновляем данные каждую секунду
        // setInterval(updateChartData, 1000);

        async function fetchDataAndUpdateChart() {
            while (true) {
                // Симулируем асинхронный запрос к серверу
                await new Promise(resolve => setTimeout(resolve, 1000)); // Ждем 1 секунду

                // Пересчитываем totalValue
                var totalValue = aggTrue + aggFalse + aggError;

                // Обновляем данные диаграммы
                chart.data = [
                    {
                        country: "Ишда",
